import './App.css';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />
        <div>
        <p>
          Let's play a small game, choose a difficulty
        </p>
        </div>
        <div class='difficulty_selector'>
        <button type="button" class='diffbut'>Easy</button>
        <button type="button" class='diffbut'>Normal</button>
        <button type="button" class='diffbut'>Hard</button>
        </div>
      </header>
    </div>
  );
}

export default App;
